    margin: theme.spacing(0, 0, 0),
    // backgroundColor: theme.palette.primary.main
  },
  subtitle: {
    letterSpacing: '2px',
    fontSize: '0.75rem',
    textTransform: 'uppercase',
    padding: theme.spacing(0, 0, 10, 0)
  }
}));

export default useStyles
